import React from 'react';

function Services() {
  return (
    <section className="services">
      <div className="container">
        <h2>Services</h2>
        <div className="service-section">
          <div className="service-text">
            <h3>Selling</h3>
            <p>
              GET HELP WITH<br />
              Our combination of skill, experience, and technology ensures that we can sell your home for the highest possible price!
            </p>
            <button className="btn">Why Choose Me</button>
            <button className="btn" style={{ marginTop: '0.5rem' }}>Selling Process</button>
            <button className="btn" style={{ marginTop: '0.5rem' }}>Free Home Evaluation</button>
          </div>
          <div className="service-image">
            <img src="/images/Line.jpg" alt="Selling" />
          </div>
        </div>
        <div className="service-section" style={{ marginTop: '2rem' }}>
          <div className="service-text">
            <h3>Buying</h3>
            <p>
              GET HELP WITH<br />
              When it comes to buying your home in Ottawa, Joanne Wang provides the resources you need to make an informed decision. Learn about the buying process today.
            </p>
            <button className="btn">Why Choose Me</button>
            <button className="btn" style={{ marginTop: '0.5rem' }}>Buying Process</button>
          </div>
          <div className="service-image">
            <img src="/images/Line.jpg" alt="Buying" />
          </div>
        </div>
      </div>
    </section>
  );
}

export default Services;
